MongoDB Aggregation - Keeping field names<p>I have a collection of documents that are scores per round of golf. I am trying to:</p>
<ul>
<li>group these by <code>playerId</code></li>
<li>total the scores across ALL rounds (documents)</li>
<li><code>$push</code> the original document's array of <code>$holes</code> for later use</li>
<li>add each original document's <code>courseId</code> into the above array, to reference later</li>
</ul>
<p>I have everything but the last part, with this Aggregation stage:</p>
<pre><code>{
  _id: &quot;$playerName&quot;,
  total: {
    $sum: &quot;$total&quot;
  },
  rounds: { $push: &quot;$holes&quot; }
}
</code></pre>
<p>I don't know how to add extra fields to this stage keeping the <code>courseId</code> value from each source document. I have seen <code>$$ROOT</code> but I don't need everything.</p>
<p>When I do this, <code>rounds</code> is an <code>Array</code> of <code>Objects</code>, as:</p>
<pre><code>{
  &quot;_id&quot; : &quot;Tiger Woods&quot;,
  &quot;total&quot; : 45
  &quot;rounds&quot; : {
    0 : { { 1 : 2 }, { 2: 2 }, ... },
    1 : { ... },
    2 : { ... }
  }
}
</code></pre>
<p><a href="https://i.stack.imgur.com/ugRJT.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/ugRJT.png" alt="round sub-doc structure" /></a></p>
<p>I would like to put in the <code>key</code> name part of the above array with the <code>courseId</code> value, so it can be used later - or any other way to reference it:</p>
<pre><code>{
  &quot;_id&quot; : &quot;Tiger Woods&quot;,
  &quot;total&quot; : 45
  &quot;rounds&quot; : {
    &quot;course1&quot; : { ... },
    &quot;course2&quot; : { ... },
    &quot;courseN&quot; : { ... }
  }
}
</code></pre>
<p>The original document structure is - there is 1 document &quot;per comp per course&quot; played:</p>
<pre><code>{
    &quot;compId&quot;: &quot;607019361c071256e4f0d0d5&quot;,
    &quot;courseId&quot;: &quot;608952e3abebbd503ba6e115&quot;,
    &quot;playerId&quot;: &quot;609d0993906429612483cea0&quot;,
    &quot;holes&quot;: {
        &quot;1&quot;: 2,
        &quot;2&quot;: 1,
        &quot;3&quot;: 2,
        &quot;4&quot;: 2,
        &quot;5&quot;: 2,
        &quot;6&quot;: 2,
        &quot;7&quot;: 0,
        &quot;8&quot;: 2,
        &quot;9&quot;: 3
    },
    &quot;playerName&quot;: &quot;Tiger Woods&quot;,
    &quot;total&quot;: 16
}
</code></pre>
<p>I need to reference which <code>courseId</code> with each <code>rounds</code> array element. I thought it might be the <code>key</code> part of the key/value pair but I can only name the whole <code>Array</code> as &quot;rounds&quot;</p>
<p>Or maybe it's because the original <code>holes</code> is an Object, not an Array? How would I change this?</p>

