MongoDB references and endpoints<p>I am trying to make an endpoint display a name when i am using the ObjectID reference to filter the data. I have the Schema.</p>
<pre><code>let movieSchema = mongoose.Schema({
  Title:{type: String, required:true},
  description: {type: String, required:true},
  genre: [{ type: mongoose.Schema.Types.ObjectId, ref: 'Genre'}],
  director: [{ type: mongoose.Schema.Types.ObjectId, ref: 'Director'}],
  Actors: [String],
  imageUrl: String,
  featured: Boolean
});

let genreSchema = mongoose.Schema({
  name: {type: String, required: true},
  description: String
});
</code></pre>
<p>I currently have the endpoint to display all movies with the genre ID like so.</p>
<pre><code>app.get('/movies/:genre',  passport.authenticate('jwt', {session:false}), (req, res) =&gt; {
  const genre = req.params.objectID;
  Movies.find({ 'genre.type':genre })
    .then((movies) =&gt; {
      res.status(201).json(movies);
    })
    .catch((err) =&gt; {
      console.error(err);
      res.status(500).send('Error: ' + err);
    });
});
</code></pre>
<p>What i am hoping to achieve and do not know where to start with this, it to have the endpoint not use the actual ID but the name instead. So i can still use the reference in the database but instead i could use the endpoint &quot;/movies/thrillers&quot; instead of &quot;/movies/601511816...&quot; ect.</p>
<p>Is this possible?</p>

