        required=&quot;required&quot;
        type=&quot;text&quot;
        className=&quot;form-control&quot;
        placeholder={category}
        value={category}
        onChange={e =&gt; setcategory(e.target.value)}
      /&gt;
      &lt;br /&gt;

      &lt;input
        type=&quot;text&quot;
        onChange={e =&gt; setauthor(e.target.value)}
        className=&quot;form-control&quot;
        required=&quot;required&quot;
        placeholder={author}
        value={author}
      /&gt;
      &lt;br /&gt;

      &lt;input
        type=&quot;text&quot;
        onChange={e =&gt; setingredients(e.target.value)}
        className=&quot;form-control&quot;
        required=&quot;required&quot;
        placeholder={ingredients}
        value={ingredients}
      /&gt;

      &lt;br /&gt;
      &lt;input
